"219651":{"id":"219651","name":"De Volta às Raízes","slug":"de-volta-as-raizes","original_title":"웰컴투 삼달리","overview":"Após um escândalo desastroso, uma fotógrafa volta à sua cidade natal e reencontra um amigo de infância, reacendendo a chama de um antigo romance.","first_air_date":"2023-12-02","episode_run_time":69,"vote_average":8.3,"number_of_seasons":1,"number_of_episodes":16,"created_by":["Kwon Hye-ju"],"production_companies":["SLL","MI"],"genres":["Drama"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/wyfS7XJLlAfRzIsLBW4iuQpllZK.jpg","poster_path":"https://image.tmdb.org/t/p/original/tUkjcpOZqrL1eGgdns7yd7QX9Oh.jpg","cast":["지창욱","신혜선","유오성","김미경","서현철"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/8ANpOw7HGAEHwZXaRp0Ycbf6bkQ.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/8ANpOw7HGAEHwZXaRp0Ycbf6bkQ.jpg","air_date":"2023-12-02","episode_count":16,"overview":"Após um escândalo abalar seu mundo, uma fotógrafa renomada faz uma inesperada mudança em sua exigente vida em Seul e faz um retorno espontâneo à sua cidade natal em Jeju Island, que ela evitava há muito tempo.","vote_average":0,"episodes":{"1":{"name":"As lágrimas do dragão","overview":"Depois de uma briga com a assistente, Cho Sam-dal se envolve em um escândalo. Agora, o único jeito de fazer isso passar vai ser se esconder na sua cidade natal.","air_date":"2023-12-02","runtime":70,"still_path":"https://image.tmdb.org/t/p/original/gw7kNz95AQyYaB6bSiTfwn3kKIY.jpg","vote_average":0},"2":{"name":"Uma história de parceria","overview":"Sam-dal está no fundo do poço e acaba tendo um encontro bizarro com Cho Yong-pil. Mais tarde, a situação começa a mudar um pouco de figura.","air_date":"2023-12-03","runtime":65,"still_path":"https://image.tmdb.org/t/p/original/q5TKHDCTYTeTzj0Ea5vqQGVadrz.jpg","vote_average":0},"3":{"name":"Como aves selvagens, elevando-se, sonhando, descendo","overview":"As pessoas ficam sabendo que Sam-dal chegou, e ela evita sair em público. Uma conversa a deixa chateada.","air_date":"2023-12-09","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/tv13kY7rC1Afn9BdjJ0l7VqADeJ.jpg","vote_average":0},"4":{"name":"A maçã podre dos meus olhos","overview":"Com o burburinho da cidade, Sam-dal revela a verdade para sua comunidade. Envergonhada, ela mente para Yong-pil sobre sua vida amorosa.","air_date":"2023-12-10","runtime":66,"still_path":"https://image.tmdb.org/t/p/original/wP0tKhLeNPpAeabeLVjVMZV8Ul4.jpg","vote_average":0},"5":{"name":"Eu vejo você","overview":"Yong-pil demonstra preocupação com Sam-dal, e ela o confronta. Um repórter aparece na cidade de Sam-dal, mas seus amigos a defendem.","air_date":"2023-12-16","runtime":68,"still_path":"https://image.tmdb.org/t/p/original/bRh4AHvm4qS3bM34BRd9BB5aDZF.jpg","vote_average":0},"6":{"name":"\"The Dreams\" de Cho Yong-pil","overview":"Yong-pil compete com Bu Sang-do por Sam-dal. Após descobrir o esquema de Bang Eun-ju, Sam-dal vai a Seul para saber a verdade.","air_date":"2023-12-17","runtime":71,"still_path":"https://image.tmdb.org/t/p/original/z2WD5amQn723CSdZ5YPWuZzIbyZ.jpg","vote_average":0},"7":{"name":"Terminando, com amor","overview":"Sang-do confronta Yong-pil sobre os sentimentos que ambos têm em relação a Sam-dal. A mãe de Sam-dal começa a suspeitar que há algo entre ela e Yong-pil.","air_date":"2023-12-23","runtime":71,"still_path":"https://image.tmdb.org/t/p/original/em4GIqWXNtMq4zpGzN85uDBAI7k.jpg","vote_average":0},"8":{"name":"A chuva das samambaias de Jeju","overview":"Com problemas de saúde, Ko Mi-cha tem uma experiência assustadora durante um mergulho. Sam-dal é incentivada a participar de um concurso de fotos.","air_date":"2023-12-24","runtime":72,"still_path":"https://image.tmdb.org/t/p/original/7pXX29ipIuGoLdyIVfjrPljMA3C.jpg","vote_average":0},"9":{"name":"A história das duas Mi-chas","overview":"Mi-cha continua lutando pela vida. Sam-dal descobre que a mãe escondeu seus problemas de saúde e que Yong-pil sempre esteve presente.","air_date":"2023-12-30","runtime":72,"still_path":"https://image.tmdb.org/t/p/original/z7VM2aR6SQCy3U5B5AzJ8uNnavL.jpg","vote_average":0},"10":{"name":"As variáveis que não pudemos prever","overview":"Sam-dal sente vergonha por se aproximar de Yong-pil em uma noite de bebedeira. Selecionados para um concurso de fotografia, os dois passeiam pela cidade.","air_date":"2023-12-31","runtime":71,"still_path":"https://image.tmdb.org/t/p/original/4qszzZXODwgGuMqUWvHrO3OGh7X.jpg","vote_average":0},"11":{"name":"O que não me mata me fortalece","overview":"Um homem do passado de Cho Jin-dal enfurece a família dela com um anúncio imprudente. Sam-dal continua sofrendo por Yong-pil.","air_date":"2024-01-06","runtime":72,"still_path":"https://image.tmdb.org/t/p/original/yzGDJZK8LIJP6P0zRBYVD8h506e.jpg","vote_average":0},"12":{"name":"Bem-vinda ao lar","overview":"Sam-dal tem medo da opinião da mãe sobre o relacionamento com Yong-pil. Após publicar um vídeo de Sam-dal, Eun-ju vai a Samdal-ri.","air_date":"2024-01-07","runtime":70,"still_path":"https://image.tmdb.org/t/p/original/uDsAPv7GBQqFxHlGz4HAHKpCIs9.jpg","vote_average":0},"13":{"name":"Aquele maldito amor não correspondido","overview":"O pai de Yong-pil não aprova a aproximação de Sam-dal. Em meio a muita tensão, Mi-cha finalmente cria coragem para defender seu passado.","air_date":"2024-01-13","runtime":73,"still_path":"https://image.tmdb.org/t/p/original/lYLUI87WbJbCQs75egVw7eVRkk2.jpg","vote_average":0},"14":{"name":"Quando suas lágrimas secarem","overview":"Sam-dal e Yong-pil decidem aproveitar uma sessão de fotos, mas acabam tendo que lidar com duas visitas inesperadas. Sam-dal tenta conquistar o pai de Yong-pil.","air_date":"2024-01-14","runtime":72,"still_path":"https://image.tmdb.org/t/p/original/rRBPjS4YYw2SpnufpnfEnYxIcJH.jpg","vote_average":0},"15":{"name":"É preciso um vilarejo para criar um dragão","overview":"Eun-ju planta uma história sobre Sam-dal, complicando sua participação na competição de fotografia, mas a cidade se une para ajudá-la na exibição.","air_date":"2024-01-20","runtime":70,"still_path":"https://image.tmdb.org/t/p/original/xiO9arsxZARtHtV625k3smvxG3P.jpg","vote_average":0},"16":{"name":"De volta às raízes","overview":"Com as mentiras de Eun-ju reveladas, Sam-dal realiza sua exibição. Posteriormente, ela descobre o sonho secreto de Yong-pil e sua hesitação em realizá-lo.","air_date":"2024-01-21","runtime":76,"still_path":"https://image.tmdb.org/t/p/original/t6PLcl4A0LG3wg3LXUP5fNA38dO.jpg","vote_average":0}}}}},
