"208550":{"id":"208550","name":"Planeta Sexo com Cara Delevingne","slug":"planeta-sexo-com-cara-delevingne","original_title":"Planet Sex with Cara Delevingne","overview":"Cara é atriz, uma das pessoas mais fotografadas do mundo e ícone LGBTQ+ premiada. Nesta jornada imersiva, ela coloca seu corpo e sua mente em jogo para buscar respostas sobre a sexualidade humana, suas alegrias, mistérios e natureza em constante mudança. Em cada episódio, ela compartilha suas próprias experiências. Sem filtros e extremamente autêntica, Cara está disposta a tudo para explorar o que nos torna humanos.","first_air_date":"2022-12-01","episode_run_time":45,"vote_average":6.6,"number_of_seasons":1,"number_of_episodes":6,"created_by":["Simon Andreae","Cara Delevingne"],"production_companies":["Naked","Milkshake Productions","Cara & Co."],"genres":["Documentário"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/eU6V3zTvBgT0jDnHexXumSIMiMh.jpg","poster_path":"https://image.tmdb.org/t/p/original/pgNVMxQ6OvSyVlZ1zEKIpSIFOv3.jpg","cast":["Cara Delevingne"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/pgNVMxQ6OvSyVlZ1zEKIpSIFOv3.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/pgNVMxQ6OvSyVlZ1zEKIpSIFOv3.jpg","air_date":"2022-12-01","episode_count":6,"overview":"N/A","vote_average":9.6,"episodes":{"1":{"name":"A Disparidade de Orgasmo","overview":"De acordo com alguns especialistas, os homens aproveitam mais o sexo do que as mulheres. Cara parte em uma missão para entender o que está por trás dessa tal de \"disparidade do orgasmo\".","air_date":"2022-12-01","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/fLFxWuqbSCcvgtSxhOulW6h78yS.jpg","vote_average":9.2},"2":{"name":"Assumido e Orgulhoso?","overview":"Cara cresceu sentindo vergonha de sua sexualidade e com medo de explorá-la. Neste episódio, Cara conhece pessoas que vivem suas vidas em voz alta e orgulhosas.","air_date":"2022-12-08","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/fQKS8kHNp9Z0UAL7FVJKY19hvZ.jpg","vote_average":10},"3":{"name":"Pornocópia","overview":"Cara conhece cineastas e empresárias éticas e feministas que estão mudando o mundo da pornografia.","air_date":"2022-12-15","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/zf9DI7aQ93hRCilPvexWmxeTCHz.jpg","vote_average":0},"4":{"name":"Qual é o Seu Gênero?","overview":"Cara faz drag e conhece pessoas trans, não-binárias e intersexuais ao redor do mundo para descobrir o gênero e se ele é fixo, fluido ou algo completamente diferente.","air_date":"2022-12-22","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/1tRmekOxnvOtOsl94jF1U5yX6rJ.jpg","vote_average":0},"5":{"name":"Monogamia","overview":"Na tentativa de entender a monogamia e por que as pessoas traem, Cara conhece pessoas em relacionamentos sérios que fazem as coisas de maneira diferente.","air_date":"2022-12-29","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/7VAvWS9cdvG6oC8zo1KpRnDCTMd.jpg","vote_average":0},"6":{"name":"Você me acha Sexy?","overview":"Sentindo-se insegura, Cara consulta um cirurgião plástico e investiga a origem de nossos ideais de beleza.","air_date":"2023-01-05","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/dNhrl4aYlaD3m981e6e8WB8MVuk.jpg","vote_average":0}}}}},
